            "content": "Value LINE ((\\*\\s+)?\\d+\\s+(con|aux|tty|vty)\\s+\\d+)\nValue USER (\\S+)\nValue HOSTS (\\S+)\nValue IDLE (\\S+)\nValue LOCATION (\\S+)\n\nStart\n  ^\\s*Line\\s+User\\s+Host\\(s\\)\\s+Idle\\s+Location\\s*$$ -> UsersTable\n  ^\\s*$$\n  ^. -> Error\n\nUsersTable\n  ^\\s*${LINE}(?:\\s+${USER})?(?:\\s+${HOSTS})?\\s+${IDLE}(?:\\s+${LOCATION})?\\s*$$ -> Record\n  ^\\s*Interface\\s+User\\s+Mode\\s+Idle\\s+Peer\\s+Address\\s*$$\n  ^\\s*$$\n  ^. -> Error\n"
