            "content": "Value Required VLAN_ID (\\d+)\n# Name is really the description and it currently only supports a single word (no spaces)\nValue Required STATUS (\\w+)\nValue VLAN_NAME ([^TU][^\\s]\\S+(\\s\\S+)*)\nValue PORTS_U_GI (\\S+)\nValue PORTS_T_GI (\\S+)\nValue PORTS_U_TE (\\S+)\nValue PORTS_T_TE (\\S+)\nValue PORTS_U_FO (\\S+)\nValue PORTS_T_FO (\\S+)\nValue PORTS_U_MA (\\S+)\nValue PORTS_T_MA (\\S+)\n\nStart\n  ^(\\*)?\\s+\\d+.* -> Continue.Record\n  ^(\\*)?\\s+${VLAN_ID}\\s+${STATUS}(\\s+${VLAN_NAME})?(\\s+(U Gi ${PORTS_U_GI}|T Gi ${PORTS_T_GI}|U Ma ${PORTS_U_MA}|T Ma ${PORTS_T_MA}|U Te ${PORTS_U_TE}|T Te ${PORTS_T_TE}|U Fo ${PORTS_U_FO}|T Fo ${PORTS_T_FO}))?\n  ^\\s+U Gi ${PORTS_U_GI}\n  ^\\s+T Gi ${PORTS_T_GI}\n  ^\\s+U Ma ${PORTS_U_MA}\n  ^\\s+T Ma ${PORTS_T_MA}\n  ^\\s+U Te ${PORTS_U_TE}\n  ^\\s+T Te ${PORTS_T_TE}\n  ^\\s+U Fo ${PORTS_U_FO}\n  ^\\s+T Fo ${PORTS_T_FO}\n"
