        "show interfaces": {
            "file": "hp_procurve_show_interfaces.textfsm",
            "content": "Value PORT (\\S+)\nValue TOTAL_BYTES (\\S+)\nValue TOTAL_FRAMES (\\S+)\nValue ERRORS_RX (\\S+)\nValue DROPS_TX (\\S+)\nValue FLOW_CTRL (off|on)\nValue BCAST_LIMIT (\\d+)\n\nStart\n  ^\\s+Status.*Counters\\s*\n  ^\\s*$$\n  ^\\s+Flow\\s*\n  ^\\s+Port.*Ctrl\\s*\n  ^\\s+-+\\s+-+\\s+-+\\s+-+\\s+-+\\s-+\\s*$$ -> ShowInterfaces1\n  ^\\s+Flow\\s+Bcast\\s*\n  ^\\s+Port.*Limit\\s*\n  ^\\s+-+\\s+-+\\s+-+\\s+-+\\s+-+\\s+-+\\s-+\\s*$$ -> ShowInterfaces2\n\n\nShowInterfaces1\n  ^\\s+${PORT}\\s+${TOTAL_BYTES}\\s+${TOTAL_FRAMES}\\s+${ERRORS_RX}\\s+${DROPS_TX}\\s+${FLOW_CTRL}\\s*$$ -> Record\n  ^\\s*$$\n  ^. -> Error\n\nShowInterfaces2\n  ^\\s+${PORT}\\s+${TOTAL_BYTES}\\s+${TOTAL_FRAMES}\\s+${ERRORS_RX}\\s+${DROPS_TX}\\s+${FLOW_CTRL}\\s+${BCAST_LIMIT}\\s*$$ -> Record\n  ^\\s*$$\n  ^. -> Error\n"
        },
        "show interfaces brief": {
            "file": "hp_procurve_show_interfaces_brief.textfsm",
            "content": "Value PORT ([a-zA-Z0-9\\-]+)\nValue TYPE (\\S*)\nValue INTRUSION_ALERT (Yes|No)\nValue ENABLED (Yes|No)\nValue STATUS (Up|Down)\nValue MODE ([a-zA-Z0-9\\.]+)\nValue MDI_MODE (MDI\\S*|Auto|NA)\nValue FLOW_CTRL (on|off)\nValue BCAST_LIMIT (\\d+)\n\nStart\n  ^\\s+Status.*Status\\s*\n  ^\\s*$$\n  ^\\s*Note:\\s*\\*.*$$\n  ^\\s+\\|\\s+Intrusion\\s+MDI\\s+Flow(?:\\s+Bcast)?\\s*$$\n  ^\\s+Port\\s+Type\\s+\\|\\s+Alert\\s+Enabled\\s+Status\\s+Mode\\s+Mode\\s+Ctrl\\s*$$ -> showintbrief1\n  ^\\s+Port\\s+Type\\s+\\|\\s+Alert\\s+Enabled\\s+Status\\s+Mode\\s+Mode\\s+Ctrl\\s+Limit\\s*$$ -> showintbrief2\n  ^. -> Error\n\nshowintbrief1\n  ^\\s+${PORT}\\*?\\s+${TYPE}\\s+\\|\\s+${INTRUSION_ALERT}\\s+${ENABLED}\\s+${STATUS}\\s+${MODE}?\\*?\\s+(?:${MDI_MODE}\\s+)?${FLOW_CTRL}\\s*$$ -> Record\n  ^\\s*-+(?:\\s|-|\\+)+$$\n  ^\\s*\\*\\s+third-party.*$$\n  ^\\s*$$\n  ^. -> Error\n\nshowintbrief2\n  ^\\s+${PORT}\\*?\\s+${TYPE}\\s+\\|\\s+${INTRUSION_ALERT}\\s+${ENABLED}\\s+${STATUS}\\s+${MODE}?\\*?\\s+(?:${MDI_MODE}\\s+)?${FLOW_CTRL}\\s+${BCAST_LIMIT}\\s*$$ -> Record\n  ^\\s*-+(?:\\s|-|\\+)+$$\n  ^\\s*\\*\\s+third-party.*$$\n  ^\\s*$$\n  ^. -> Error\n\n"
        },
