            "content": "Value VLAN_NAME (.+?)\nValue CONFIG (\\S+)\nValue IP_ADDRESS (\\S+)\nValue SUBNET_MASK (\\S+)\nValue PROXY (\\S+)\nValue LOCAL (\\S+)\n\nStart\n  ^\\s*Internet\\s+\\(IP\\)\n  ^\\s*IP\\s+Routing\n  ^\\s*Default\\s+Gateway\n  ^\\s*Default\\s+TT\n  ^\\s*Arp\\s+Age\n  ^\\s*Domain\\s+Suffix\n  ^\\s*DNS\\s+server\n  ^\\s+\\|\\s+Proxy\n  ^\\s*VLAN\\s+ -> Interface\n  ^\\s*$$\n  ^. -> Error\n\nInterface\n  ^\\s*----\n  ^\\s*${VLAN_NAME}\\s+\\|\\s+${CONFIG}\\s+${IP_ADDRESS}\\s+${SUBNET_MASK}\\s+${PROXY}\\s+${LOCAL}\\s*$$ -> Record\n  ^\\s*${VLAN_NAME}\\s+\\|\\s+${CONFIG}\\s+${IP_ADDRESS}\\s+${SUBNET_MASK} -> Record\n  ^\\s*${VLAN_NAME}\\s+\\|\\s+${CONFIG}\\s*$$ -> Record\n  ^\\s*$$\n  ^. -> Error\n"
