        "iwconfig": {
            "file": "linux_iwconfig.textfsm",
            "content": "Value Required INTERFACE (\\S+)\nValue NICKNAME (\\S.+\\S)\nValue ESSID (\\S.+\\S|\\S+)\nValue MODE (\\S+)\nValue FREQUENCY (\\S.+\\S)\nValue ACCESS_POINT (\\S+)\nValue SENSITIVITY (\\S+)\nValue BIT_RATE (\\d+|-?\\d+(?:\\.\\d+)?\\s(?:Mb\\/s)?)\nValue TX_POWER (\\S.+\\S)\nValue RETRY_SHORT_LIMIT (\\w+)\nValue RTS_THR (\\S+)\nValue FRAGMENT_THR (\\S+)\nValue ENCRYPTION_KEY (\\S+)\nValue POWER_MANAGEMENT (\\S+)\nValue LINK_QUALITY (\\S+)\nValue SIGNAL_LEVEL (\\S+|-?\\d+(?:\\.\\d+)?\\s(?:dBm)?)\nValue NOISE_LEVEL (\\S+)\nValue RX_INVALID_NWID (\\w+)\nValue RX_INVALID_CRYPT (\\w+)\nValue RX_INVALID_FRAG (\\w+)\nValue TX_EXCESSIVE_RETRIES (\\w+)\nValue INVALID_MISC (\\w+)\nValue MISSED_BEACON (\\w+)\n\n\nStart\n  ^\\s*wl\\w+\\d+ -> Continue.Record\n  ^\\s*${INTERFACE}\\s+no\\s+wireless\\s+extensions\\.$$ -> Clear\n  ^\\s*${INTERFACE}\\s+(IEEE\\s+802\\.11\\w*|unassociated)(?:\\s+ESSID:off\\/any)?(?:\\s+Nickname:\\\"${NICKNAME}\\\")?\\s*$$\n  ^\\s*${INTERFACE}\\s+(IEEE\\s+802\\.11\\w*|unassociated)(?:\\s+ESSID:\\\"${ESSID}\\\"\\s+)?(?:\\s*Nickname:\\\"${NICKNAME}\\\")?\\s*$$\n  ^\\s*${INTERFACE}\\s+(IEEE\\s+802\\.11\\w*|unassociated)(?:\\s+Mode:${MODE}\\s+)?(?:\\s*Frequency:${FREQUENCY}\\s+)?(?:\\s*Tx-Power=${TX_POWER})?\\s*$$\n  ^\\s*Mode:\\s*${MODE}\\s+(?:Frequency(:|=)\\s*${FREQUENCY}\\s+)?Access\\s+Point:\\s+${ACCESS_POINT}(?:\\s+Tx-Power\\s*=\\s*${TX_POWER})?\\s*$$\n  ^\\s*(?:Bit\\s+Rate(:|=)${BIT_RATE})?(?:\\s*Sensitivity:${SENSITIVITY})?(?:\\s+Tx-Power=${TX_POWER})?\\s*$$\n  ^\\s*Retry(?:\\s+short\\s+limit)?:${RETRY_SHORT_LIMIT}\\s+RTS\\s+thr:${RTS_THR}\\s+Fragment\\s+thr:${FRAGMENT_THR}\\s*$$\n  ^\\s*Encryption\\s+key:\\s*${ENCRYPTION_KEY}\\s*$$\n  ^\\s*Power\\s+Management:${POWER_MANAGEMENT}\\s*$$\n  ^\\s*Link\\s+Quality(:|=)${LINK_QUALITY}\\s+Signal\\s+level(:|=)${SIGNAL_LEVEL}(?:\\s+Noise\\s+level(:|=)${NOISE_LEVEL})?\\s*$$\n  ^\\s*Rx\\s+invalid\\s+nwid:${RX_INVALID_NWID}\\s+Rx\\s+invalid\\s+crypt:${RX_INVALID_CRYPT}\\s+Rx\\s+invalid\\s+frag:${RX_INVALID_FRAG}\\s*$$\n  ^\\s*Tx\\s+excessive\\s+retries:${TX_EXCESSIVE_RETRIES}\\s+Invalid\\s+misc:${INVALID_MISC}\\s+Missed\\s+beacon:${MISSED_BEACON}\\s*$$\n  ^. -> Error"
        },
        "iwlist wlan0 scanning": {
            "file": "linux_iwlist_wlan0_scanning.textfsm",
            "content": "Value Filldown INTERFACE (\\S+)\nValue ADDRESS (\\S+)\nValue Required SSID (\\S.+\\S|\\S+)\nValue PROTOCOL (\\S.+\\S)\nValue MODE (\\S+)\nValue FREQUENCY (\\S+\\sGHz)\nValue CHANNEL (\\d+)\nValue ENCRYPTION_KEY (\\S+)\nValue List BIT_RATE (\\d+(?:\\.\\d+)?\\s(Gb|Mb|Kb)\\/s)\nValue GROUP_CIPHER (\\S.+\\S)\nValue PAIRWISE_CIPHER (\\S.+\\S)\nValue AUTHENTICATION_SUITES (\\S.+\\S)\nValue PREAUTHENTICATION (Supported)\nValue QUALITY (\\d+\\/\\d+)\nValue SIGNAL_LEVEL (-?\\d+\\/\\d+|-?\\d+\\sdBm)\nValue List EXTRA (\\S.+\\S)\nValue List INFORMATION_ELEMENT (\\S.+\\S)\n\nStart\n  ^\\s*Cell\\s+\\d+\\s* -> Continue.Record\n  ^\\s*(?:Bit\\s+Rates:\\s*)?\\s*${BIT_RATE}\\;?\\s*$$\n  ^\\s*(?:Bit\\s+Rates:\\s*)?\\s*${BIT_RATE}\\;?\\s* -> Continue\n  ^\\s*(?:Bit\\s+Rates:\\s*)?(\\s*\\d+(?:\\.\\d+)?\\s(Gb|Mb|Kb)\\/s\\;){1}\\s*${BIT_RATE}\\;?\\s*$$\n  ^\\s*(?:Bit\\s+Rates:\\s*)?(\\s*\\d+(?:\\.\\d+)?\\s(Gb|Mb|Kb)\\/s\\;){1}\\s*${BIT_RATE}\\;?\\s* -> Continue\n  ^\\s*(?:Bit\\s+Rates:\\s*)?(\\s*\\d+(?:\\.\\d+)?\\s(Gb|Mb|Kb)\\/s\\;){2}\\s*${BIT_RATE}\\;?\\s*$$\n  ^\\s*(?:Bit\\s+Rates:\\s*)?(\\s*\\d+(?:\\.\\d+)?\\s(Gb|Mb|Kb)\\/s\\;){2}\\s*${BIT_RATE}\\;?\\s* -> Continue\n  ^\\s*(?:Bit\\s+Rates:\\s*)?(\\s*\\d+(?:\\.\\d+)?\\s(Gb|Mb|Kb)\\/s\\;){3}\\s*${BIT_RATE}\\;?\\s*$$\n  ^\\s*(?:Bit\\s+Rates:\\s*)?(\\s*\\d+(?:\\.\\d+)?\\s(Gb|Mb|Kb)\\/s\\;){3}\\s*${BIT_RATE}\\;?\\s* -> Continue\n  ^\\s*(?:Bit\\s+Rates:\\s*)?(\\s*\\d+(?:\\.\\d+)?\\s(Gb|Mb|Kb)\\/s\\;){4}\\s*${BIT_RATE}\\;?\\s*$$\n  ^\\s*(?:Bit\\s+Rates:\\s*)?(\\s*\\d+(?:\\.\\d+)?\\s(Gb|Mb|Kb)\\/s\\;){4}\\s*${BIT_RATE}\\;?\\s* -> Continue\n  ^\\s*Cell\\s+\\d+\\s+-\\s+Address:\\s*${ADDRESS}\\s*$$\n  ^\\s*${INTERFACE}\\s+Scan\\s+completed\\s+:\\s*$$\n  ^\\s*Channel:\\s*${CHANNEL}\\s*$$\n  ^\\s*ESSID:\\s*\"(?:${SSID})?\"\\s*$$\n  ^\\s*Protocol:\\s*${PROTOCOL}\\s*$$\n  ^\\s*Mode:\\s*${MODE}\\s*$$\n  ^\\s*Frequency:\\s*${FREQUENCY}(?:\\s+\\(Channel\\s+${CHANNEL}\\))?\\s*$$\n  ^\\s*Encryption\\s+key:\\s*${ENCRYPTION_KEY}\\s*$$\n  ^\\s*IE:\\s+${INFORMATION_ELEMENT}\\s*$$\n  ^\\s*Group\\s+Cipher\\s*:\\s*${GROUP_CIPHER}\\s*$$\n  ^\\s*Pairwise\\s+Ciphers\\s*\\(\\d+\\)\\s*:\\s*${PAIRWISE_CIPHER}\\s*$$\n  ^\\s*Authentication\\s+Suites\\s*\\(\\d+\\)\\s*:\\s*${AUTHENTICATION_SUITES}\\s*$$\n  ^\\s*Preauthentication\\s+${PREAUTHENTICATION}\\s*$$\n  ^\\s*Quality\\s*=\\s*${QUALITY}\\s+Signal\\s+level\\s*=\\s*${SIGNAL_LEVEL}\\s*$$\n  ^\\s*Extra:\\s*${EXTRA}\\s*$$\n  ^. -> Error\n"
        },
